INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, "アヤネ", "2030/12/17 14:59:59", 0.0, 2, 2, 24001, 10046, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 24, "2020/07/31 12:00:00", 0.0, 401, 102301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2.21, "アヤネ", "2030/12/17 14:59:59", 0.0, 2, 1, 24002, 10046, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 24, "2020/07/31 12:00:00", 0.0, 402, 102301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, "アヤネ", "2030/12/17 14:59:59", 0.0, 2, 2, 24003, 10046, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 24, "2020/07/31 12:00:00", 0.0, 403, 102301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1.99, "アサヒ", "2030/12/17 14:59:59", 0.0, 1, 2, 24004, 10046, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 24, "2020/07/31 12:00:00", 0.0, 701, 192201);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2.21, "アサヒ", "2030/12/17 14:59:59", 0.0, 2, 1, 24005, 10046, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 24, "2020/07/31 12:00:00", 0.0, 702, 192201);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (3.33, "アサヒ", "2030/12/17 14:59:59", 0.0, 1, 2, 24006, 10046, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 24, "2020/07/31 12:00:00", 0.0, 703, 192201);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, "部員３", "2030/12/17 14:59:59", 0.0, 2, 2, 24007, 10046, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 24, "2020/07/31 12:00:00", 0.0, 801, 192301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2.68, "部員３", "2030/12/17 14:59:59", 0.0, 2, 1, 24008, 10046, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 24, "2020/07/31 12:00:00", 0.0, 802, 192301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, "部員３", "2030/12/17 14:59:59", 0.0, 2, 2, 24009, 10046, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 24, "2020/07/31 12:00:00", 0.0, 803, 192301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, "", "2030/12/17 14:59:59", 0.0, 1, 1, 24010, 10046, "やった！", 24, "2020/07/31 12:00:00", 0.0, 501, 192501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, "", "2030/12/17 14:59:59", 0.0, 1, 1, 24011, 10046, "勝ったよ！", 24, "2020/07/31 12:00:00", 0.0, 502, 192501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, "", "2030/12/17 14:59:59", 0.0, 1, 1, 24012, 10046, "いい調子！", 24, "2020/07/31 12:00:00", 0.0, 503, 192501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (5.33, "ミサト", "2030/12/17 14:59:59", 0.0, 2, 6, 24013, 10046, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 24, "2020/07/31 12:00:00", 0.0, 111, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (6.85, "ミサト", "2030/12/17 14:59:59", 0.0, 2, 1, 24014, 10046, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 24, "2020/07/31 12:00:00", 0.0, 112, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (3.0, "ミサト", "2030/12/17 14:59:59", 0.0, 2, 1, 24015, 10046, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 24, "2020/07/31 12:00:00", 0.0, 113, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (6.11, "ダイチ", "2030/12/17 14:59:59", 0.0, 2, 1, 24016, 10046, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 24, "2020/07/31 12:00:00", 0.0, 611, 192401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (6.75, "ダイチ", "2030/12/17 14:59:59", 0.0, 2, 1, 24017, 10046, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 24, "2020/07/31 12:00:00", 0.0, 612, 192401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, "ダイチ", "2030/12/17 14:59:59", 0.0, 2, 2, 24018, 10046, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 24, "2020/07/31 12:00:00", 0.0, 613, 192401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (4.52, "ハツネ", "2030/12/17 14:59:59", 0.0, 1, 2, 24019, 10046, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 24, "2020/07/31 12:00:00", 0.0, 211, 113401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (3.89, "ハツネ", "2030/12/17 14:59:59", 0.0, 1, 2, 24020, 10046, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 24, "2020/07/31 12:00:00", 0.0, 212, 113401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (13.49, "ハツネ", "2030/12/17 14:59:59", 0.0, 2, 1, 24021, 10046, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 24, "2020/07/31 12:00:00", 0.0, 213, 113401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (3.17, "カヤ", "2030/12/17 14:59:59", 0.0, 2, 1, 24022, 10046, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 24, "2020/07/31 12:00:00", 0.0, 311, 106501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (4.42, "カヤ", "2030/12/17 14:59:59", 0.0, 2, 1, 24023, 10046, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 24, "2020/07/31 12:00:00", 0.0, 312, 106501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2.89, "カヤ", "2030/12/17 14:59:59", 0.0, 1, 6, 24024, 10046, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 24, "2020/07/31 12:00:00", 0.0, 313, 106501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (3.71, "アヤネ", "2030/12/17 14:59:59", 0.0, 3, 4, 24025, 10046, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 24, "2020/07/31 12:00:00", 0.0, 421, 102301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (5.1, "アサヒ", "2030/12/17 14:59:59", 0.0, 1, 2, 24026, 10046, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 24, "2020/07/31 12:00:00", 0.0, 721, 192201);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (4.34, "部員３", "2030/12/17 14:59:59", 0.0, 3, 1, 24027, 10046, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 24, "2020/07/31 12:00:00", 0.0, 821, 192301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, "", "2030/12/17 14:59:59", 0.0, 1, 1, 24028, 10046, "いい勝負だったよ\nまたやろうね", 24, "2020/07/31 12:00:00", 0.0, 521, 192501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (5.62, "ミサト", "2030/12/17 14:59:59", 0.0, 2, 1, 24029, 10046, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 24, "2020/07/31 12:00:00", -360.0, 101, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (9.58, "ミサト", "2030/12/17 14:59:59", 0.0, 2, 1, 24030, 10046, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 24, "2020/07/31 12:00:00", -360.0, 102, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (0.0, "ミサト", "2030/12/17 14:59:59", 0.0, 2, 2, 24031, 10046, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 24, "2020/07/31 12:00:00", -360.0, 103, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (9.13, "ミサト", "2030/12/17 14:59:59", 0.0, 1, 2, 24032, 10046, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 24, "2020/07/31 12:00:00", -360.0, 104, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (8.27, "ミサト", "2030/12/17 14:59:59", 0.0, 2, 1, 24033, 10046, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 24, "2020/07/31 12:00:00", -360.0, 105, 113501);
